\newcommand{\myspace}{~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~}
\begin{algorithm}
\SetLine
 \SetKwComment{Comment}{}{}
 \newcommand{\comm}[1]{\Comment*{\rm\emph{#1}}}
 \SetKwInOut{Input}{input}
% \SetKwInOut{Output}{output}
{\scriptsize
\Input{\\
 $\vpinit$ \comm{initial parameter vector\myspace}\\
 $J: \vp \mapsto R$ \comm{cost function\myspace}\\
 $\lambdainit,\lambdamin,\lambdamax,$ \comm{exploration levels\myspace}\\
 $K$ \comm{roll-outs per update\myspace}
 $h$ \comm{eliteness parameter\myspace}
}
%\Output{
% $\vp$ \comm{final parameter vector}\\
%}
\BlankLine
$\vp = \vpinit$\\
$\Sigma = \lambdainit\mathbf{I}$\\
\While{cost not converged}{

 {\em Exploration: sample parameters}\\
 \ForEach{$k$ \KwSty{in} $K$}{ 
 $\vp_{k} \sim\N{\vp}{\Sigma}$ \label{ln_sampling}\\
 $J_{k} = J(\vp_k)$ \label{ln_execute} {\em cost}\\ 
 }
 $J^\mylabel{min} = \FuncSty{min}\left(\{J_k\}_{k=1}^K\right)$\\
 $J^\mylabel{max} = \FuncSty{max}\left(\{J_k\}_{k=1}^K\right)$\\

 {\em Evaluation: compute weight for each sample}\\
 \ForEach{$k$ \KwSty{in} $K$}{
 $P_k = \frac
 {\FuncSty{exp}{\left(-h\frac{J_k-J^\mylabel{min}}{J^\mylabel{max}-J^\mylabel{min}}\right)}}
 {\sum_{l=1}^K\FuncSty{exp}{\left(-h\frac{J_l-J^\mylabel{min}}{J^\mylabel{max}-J^\mylabel{min}}\right)}}$
 }

 {\em Update: Weighted averaging over $K$ samples}\\
 $\mSigma \leftarrow \sum_{k=1}^K \left[P_k~ (\vp_{k}-\vp)(\vp_{k}-\vp)^\intercal \right]$\label{ln_pi2_update_covar} \\ 
 $\mSigma \leftarrow \FuncSty{boundcovar(}\mSigma,\lambdamin,\lambdamax)$ \label{ln_pi2_bound_covar}\label{ln_end_update}\\
 $\vp_{new} \leftarrow \sum_{k=1}^K \left[P_k \vp_{k} \right]$ \label{ln_pi2_update_mean}
}
\BlankLine
}
\end{algorithm}
